import React, { Component } from 'react';
import './show-hit.css';


export default class ShowHit extends Component {

  state = {
  };




  render() {
    const {part,power} = this.props;

    const   stylePoint={
      point1:{  width: Math.cbrt(this.props.power)*3.5+"px",
                height:Math.cbrt(this.props.power)*3.5+"px",
                lineHeight: Math.cbrt(this.props.power)*3.5+"px",
                left: "80px",
                top:"210px",
                zIndex: 2
              },
      point2:{ width: Math.cbrt(500)*3.5+"px",
               height: Math.cbrt(500)*3.5+"px",
               lineHeight: Math.cbrt(500)*3.5 +"px",
               left: "195px",
               top:"210px",
               zIndex: 2
            },
      point3:{
               width: Math.cbrt(500)*3.5+"px",
               height: Math.cbrt(500)*3.5+"px",
               lineHeight: Math.cbrt(500)*3.5 +"px",
               left: "160px",
               top:"150px",
               zIndex: 2
             },
      point4:{
               width: Math.cbrt(500)*3.5+"px",
               height: Math.cbrt(500)*3.5+"px",
               lineHeight: Math.cbrt(500)*3.5 +"px",
               left: "115px",
               top:"150px",
               zIndex: 2
              }
    }



    return (
      <div> 
                     <img src={require('../../body1.png')} alt='d2'/> 
                     <div className="circle" style={stylePoint.point1}>{power}</div>
                     <div className="circle" style={stylePoint.point2}>500</div>
                     <div className="circle" style={stylePoint.point3}>400</div>
                     <div className="circle" style={stylePoint.point4}>300</div>      

      </div>
    )
  }
}
